script: |
  super -f text -I q9502.spq | sort > q9502.out

inputs:
  - name: q9502.spq
    data: |
      SELECT ALL - 52 AS col2 FROM tab2 (FORMAT parquet) WHERE NOT 49 NOT BETWEEN ( - ( + 39 ) / 47 * col0 - 52 / + - col1 - - col0 + + + 63 * + col2 ) AND + CAST ( NULL AS INTEGER );
  - name: tab2

outputs:
  - name: q9502.out
    data: |
